#include "Solution.h"
#include <cassert>

int maximal_square::Solution::maximalSquare(vector<vector<char>> &matrix) {
    int answer = 0;
    vector<vector<int>> matrix_int;
    for (int i = 0; i < matrix.size(); i++) {
        vector<int> row;
        for (int j = 0; j < matrix[0].size(); j++) {
            row.push_back(matrix[i][j] - '0');
        }
        matrix_int.push_back(row);
    }

    for (int i = 1; i < matrix_int.size(); i++) {
        for (int j = 1; j < matrix_int[i].size(); j++) {
            if (matrix_int[i][j] == 1) {
                int current_max = min(matrix_int[i - 1][j], matrix_int[i][j - 1]);
                matrix_int[i][j] = 1 + min(current_max, matrix_int[i - 1][j - 1]);
            }
        }
    }

    for (auto & row : matrix_int)
        for (auto & item : row)
            if (answer < item)
                answer = item;

    return answer * answer;
}

